var input = ["", "", "", "", ""]

var keys = [[1,2,3],[4,5,6],[7,8,9]];
var coords = [1,1];

var inc = function(x) {
  if (x < 2) { return x+1; }
  return x; 
}
var dec = function(x) {
  if (x > 0) { return x-1; }
  return x; 
}

var code = "";
for(var i = 0; i < input.length; i++) {
  var inst = input[i];
  for(var j = 0; j < inst.length; j++) {
    var c = inst[j];
    switch(c) {
      case 'U':
        coords[0] = dec(coords[0]);
        break;
      case 'D':
        coords[0] = inc(coords[0]);
        break;
      case 'R':
        coords[1] = inc(coords[1]);
        break;
      case 'L':
        coords[1] = dec(coords[1]);
        break;
    }
  }
  code = code + keys[coords[0]][coords[1]];
} 

console.log("part 1: " + code);